import React from "react";
import ReactDOM from "react-dom";
import posed from "react-pose";
//import image from "../public/asset/kobeBryant.jpg";

const Vote = posed.div({
    hidden: { opacity: 0 },
    visible: { opacity: 1 }
});

class Cell extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            isVisible: false
        }
        this.handleClick = this.handleClick.bind(this);
    }

    handleClick(event) {
        this.setState({
            isVisible: !this.state.isVisible
        });
    }

    componentDidMount() {
        const current = ReactDOM.findDOMNode(this);
        let button = current.querySelector(".upVote");
        let player = this.props[0].name;
        console.log(player);
        button.addEventListener("click", (e) => {
            fetch("/nba/" + player, {
                method: "post",
                body: {
                    "name": player
                }
            });
        })
    }


    render() {
        const { isVisible } = this.state;
        return (

            <tr className="row">
                <Vote className="ticket" pose={isVisible ? "visible" : "hidden"}></Vote>
                <th>{this.props[1]}</th>
                <th>
                    <div className="image_border">
                        <img src={this.props[0].image} className="profile_pic" alt="" >
                        </img>
                        <div className="medal"></div>
                    </div></th>
                <th><div className="name">{this.props[0].name}</div></th>
                <th>
                    <a className="upVote">
                        <img src="/asset/vote_btn.svg" onClick={this.handleClick}></img>
                    </a>
                </th>
                <th className="count">{this.props[0].count}</th>
            </tr>
        );
    }
}

export default Cell;
